essentials/getting-started.html.body:
はじめにガイド内のコードのサンプルは ES2015 を使っています。Vue.js と vue-router を使ったシングルページアプリケーションの構築は驚くほど簡単です。Vue.js のコンポーネントを使ってアプリケーションを既に構成しています。vue-router を混ぜ込むには、コンポーネントとルートをマッピングさせて vue-router にどこで描画するかを知らせるだけです。以下が基本的な例です。すべての example では、vue の完全バージョンを使用してテンプレートを解析可能にしています。詳細はこちらを参照してください。HTML



  Hello App!



    ` は `` タグとして描画されます -->
    Go to Foo
    Go to Bar





JavaScript// 0. モジュールシステムを使っている場合 (例: vue-cli 経由で)、Vue と VueRouter をインポートし、`Vue.use(VueRouter)` を呼び出します。

// 1. ルートコンポーネントを定義します
// 他のファイルからインポートすることもできます
const Foo = { template: 'foo' }
const Bar = { template: 'bar' }

// 2. ルートをいくつか定義します
// 各ルートは 1 つのコンポーネントとマッピングされる必要があります。
// このコンポーネントは実際の `Vue.extend()`、
// またはコンポーネントオプションのオブジェクトでも構いません。
// ネストされたルートに関しては後で説明します
const routes = [
  { path: '/foo', component: Foo },
  { path: '/bar', component: Bar }
]

// 3. ルーターインスタンスを作成して、ルートオプションを渡します
// 追加のオプションをここで指定できますが、
// この例ではシンプルにしましょう
const router = new VueRouter({
  routes // `routes: routes` の短縮表記
})

// 4. root となるインスタンスを作成してマウントします
// アプリケーション全体がルーターを認知できるように、
// ルーターをインジェクトすることを忘れないでください。
const app = new Vue({
  router
}).$mount('#app')

// これで開始です!
ルーターを注入することによって、this.$router と同様、任意のコンポーネント内部で現在のルートを this.$route としてアクセスすることができます:// Home.vue
export default {
  computed: {
    username () {
      // `params` が表示される
      return this.$route.params.username
    }
  },
  methods: {
    goBack () {
      window.history.length > 1
        ? this.$router.go(-1)
        : this.$router.push('/')
    }
  }
}
ドキュメントを通して、しばしば router インスタンスを使用することがよくあります。this.$router は router を使用するのと全く同じです。this.$router を使用する理由は、ルーティング操作する必要がある全てのコンポーネントにルーターをインポートしたくないからです。動作 の例も確認してみてください. は対象のルートがマッチした時に自動的に .router-link-active が付与されるのにお気づきでしょうか。
より詳細については API リファレンス をご参照ください。

essentials/dynamic-matching.html.body:
動的ルートマッチングパターンを使って同じコンポーネントにルートをマップする必要がしばしばあるでしょう。例えば、 User コンポーネントは全てのユーザーに対して描画されるべきであるが、それぞれ異なるユーザー ID を持つ場合などです。vue-router ではパスの中の動的なセグメントを使用して実現できます。const User = {
  template: 'User'
}

const router = new VueRouter({
  routes: [
    // コロンで始まる動的セグメント
    { path: '/user/:id', component: User }
  ]
})
これで /user/foo や /user/bar などの URL 両方とも同じルートにマッチします。動的セグメントはコロン : を使って表されます。ルートがマッチした時、この動的セグメントの値は全てのコンポーネント内で this.$route.params として利用可能になります。したがって、現在の User のテンプレートを次のように更新することで現在のユーザー ID を表示することができます。const User = {
  template: 'User {{ $route.params.id }}'
}
こちら のデモの例も確認してみてください。1 つのルートが複数の動的なセグメントを持つこともできます。そして、それらは $route.params の一致したフィールドとマップされます。例:

パターン
マッチしたパス
$route.params

/user/:username
/user/evan
{ username: 'evan' }
/user/:username/post/:post_id
/user/evan/post/123
{ username: 'evan', post_id: 123 }


$route.params に加えて、$route オブジェクトでは $route.query (もし URL 上にクエリがあるなら) や $route.hash など便利な情報も利用可能です。それらの詳細については API リファレンス でご確認ください。パラメーター変更の検知ルートのパラメーターを使う際に特筆すべき点は、ユーザーが /user/foo から /user/bar へ遷移するときに同じコンポーネントインスタンスが再利用されるということです。 両方のルートが同じコンポーネントを描画するため、古いインスタンスを破棄して新しいものを生成するよりも効率的です。しかしながら、これはコンポーネントのライフサイクルフックが呼ばれないことを意味しています。同じコンポーネントでパラメーター変更を検知するためには、 $route オブジェクトを watch するだけです。const User = {
  template: '...',
  watch: {
    '$route' (to, from) {
      // ルートの変更の検知...
    }
  }
}
または、2.2 で導入された beforeRouteUpdate ガードを使用します:const User = {
  template: '...',
  beforeRouteUpdate (to, from, next) {
    // ルート変更に反応する...
    // next() を呼び出すのを忘れないでください
  }
}
高度なマッチングパターンvue-router はパスのマッチングエンジンとして path-to-regexp を使っています。これは Optional による動的なセグメント、Zero or more / One or more に対する要求、また、カスタム正規表現パターンまでもサポートしています。 これらの高度なパターンについてはこちらの ドキュメンテーション または、 vue-router の中でそれらを使っている こちらの例 をご参照ください。マッチングの優先度しばしば同じURLで複数のルートがマッチすることがあります。そのようなケースではマッチングの優先度はルートの定義された順番によって決定されます。先に定義されたルートほど優先度が高くなります。

essentials/nested-routes.html.body:
ネストされたルート実際のアプリケーションの UI では通常複数のレベルの階層的にネストしたコンポーネントで構成されます。ネストされたコンポーネントの特定の構造に対して URL のセグメントを対応させることはよくあります。例:/user/foo/profile                     /user/foo/posts
+------------------+                  +-----------------+
| User             |                  | User            |
| +--------------+ |                  | +-------------+ |
| | Profile      | |  +------------>  | | Posts       | |
| |              | |                  | |             | |
| +--------------+ |                  | +-------------+ |
+------------------+                  +-----------------+
vue-router を使えば、これらのネストされたルートの設定を使って関連付けをシンプルに表現することができます。前の章で作ったアプリケーションを考えてみましょう。


const User = {
  template: 'User {{ $route.params.id }}'
}

const router = new VueRouter({
  routes: [
    { path: '/user/:id', component: User }
  ]
})
ここでの  はトップレベルのアウトレットです。トップレベルのルートによってマッチしたコンポーネントが描画されます。同様に描画されたコンポーネントもまた自身のネストされた  を持つことができます。User コンポーネントのテンプレート内部に 1 つ追加する例です。const User = {
  template: `

      User {{ $route.params.id }}


  `
}
このネストされたアウトレットに対してコンポーネントを描画するためには、 VueRouter のコンストラクタの設定で children オプションを使用する必要があります。const router = new VueRouter({
  routes: [
    { path: '/user/:id', component: User,
      children: [
        {
          // /user/:id/profile がマッチした時に
          // UserProfile は User の  内部で描画されます
          path: 'profile',
          component: UserProfile
        },
        {
          // /user/:id/posts がマッチした時に
          // UserPosts は User の  内部で描画されます
          path: 'posts',
          component: UserPosts
        }
      ]
    }
  ]
})
/ から始まるネストされたパスは root パスとして扱われることに注意してください。これによってネストされた URL を指定しなくてもコンポーネントをネストすることができます。children オプションを見るとわかる通り、これは routes 自身と同じようなルート設定オブジェクトの配列です。したがって、ネストしている view を必要なだけ保持することができます。ここまでの点では、上記の設定で /user/foo に訪れた時に User アウトレット内部で何も描画されません。なぜならば、サブルートにマッチしていないからです。そこに何か描画したい場合は、空のサブルートパスを設定できます。const router = new VueRouter({
  routes: [
    {
      path: '/user/:id', component: User,
      children: [
        // /user/:id がマッチした時に
        // UserHome は User の  内部で描画されます
        { path: '', component: UserHome },

        // 他のサブルートも同様に...
      ]
    }
  ]
})
この例の動作デモは こちら です。

essentials/named-routes.html.body:
名前付きルートしばしば、名前を使ってルートを特定できるとより便利です。特にルートにリンクするときやナビゲーションを実行するときなどです。Router インスタンスを作成するときに routes オプションの中でルートに名前を付けることができます。const router = new VueRouter({
  routes: [
    {
      path: '/user/:id',
      name: 'user',
      component: User
    }
  ]
})
名前を付けたルートにリンクするには、 router-link コンポーネントの to プロパティにオブジェクトを渡します。User
これはプログラムで router.push() を呼び出すときに使われるオブジェクトと全く同じです。router.push({ name: 'user', params: { userId: 123 }})
どちらのケースもルーターは /user/123 のパスにナビゲーションします。完全な例は こちら です。

essentials/named-views.html.body:
名前付きビューしばしば、ネストをさせずに同時に複数の view を表示する必要があるでしょう。例えば、sidebar view と main view を使ったレイアウトを作成する時です。そんな時に名前付きビューは便利です。あなたの view に 1 つのアウトレットを持つのではなく、複数のそれぞれが名前付きの view を持つことができます。名前を持たない router-view はその名前として default が付与されます。


1 つの view は 1 つのコンポーネントを使って描画されます。したがって、同じルートに対する複数の view には複数のコンポーネントが必須になります。この components (s が付いている) オプションに注意してください。const router = new VueRouter({
  routes: [
    {
      path: '/',
      components: {
        default: Foo,
        a: Bar,
        b: Baz
      }
    }
  ]
})
