essentials/redirect-and-alias.html.body:
リダイレクトとエイリアスリダイレクトroutes 設定でリダイレクトが可能です。/a から /b へリダイレクトする例:const router = new VueRouter({
  routes: [
    { path: '/a', redirect: '/b' }
  ]
})
名前付きルートに対してリダイレクトすることもできます。const router = new VueRouter({
  routes: [
    { path: '/a', redirect: { name: 'foo' }}
  ]
})
また、function を使った動的なリダイレクトもできます。const router = new VueRouter({
  routes: [
    { path: '/a', redirect: to => {
      // この function は対象のルートを引数として受け取ります
      // ここではリダイレクト先の path もしくは location を返します
    }}
  ]
})
ナビゲーションガードはリダイレクトするルートに提供されず、ターゲット上のみに適用されるということに注意してください。例では、beforeEnter または beforeLeave ガードを /a ルートに追加しても効果がありません。その他の高度な使い方として、例 をご参照ください。エイリアスリダイレクトが意図するところは、ユーザーが /a に訪問した時に URL を /b に置換し、そして /b にマッチさせます。ではエイリアスは何でしょうか?/b として扱う /a のエイリアスは、ユーザーが /b に訪問した時に URL は /b のままになります。しかし、それはまるでユーザーが /a に訪問したかのようにマッチされます。上記はルートの設定で以下のように表現されます。const router = new VueRouter({
  routes: [
    { path: '/a', component: A, alias: '/b' }
  ]
})
設定のネスト構造による制約とは異なり、エイリアスは UI 構造に任意の URL をマップするための自由さがあります。高度な使い方に関しては、 例 をご参照ください。

essentials/passing-props.html.body:
ルートコンポーネントにプロパティを渡すコンポーネントで $route を使うとコンポーネントとルートの間に密結合が生まれ、コンポーネントが特定のURLでしか使用できないなど柔軟性が制限されます。コンポーネントをルーターから分離するために props オプションを使います:  $route に結合const User = {
  template: 'User {{ $route.params.id }}'
}
const router = new VueRouter({
  routes: [
    { path: '/user/:id', component: User }
  ]
})
  props による分離const User = {
  props: ['id'],
  template: 'User {{ id }}'
}
const router = new VueRouter({
  routes: [
    { path: '/user/:id', component: User, props: true }

    // 名前付きビューによるルートに対しては、名前付きビューごとに `props` オプションを定義しなければなりません:
    {
      path: '/user/:id',
      components: { default: User, sidebar: Sidebar },
      props: { default: true, sidebar: false }
    }
  ]
})
これにより、コンポーネントをどこからでも使用できるようになり、コンポーネントの再利用とテストが容易になります。Boolean モードprops を true に設定すると、route.params がコンポーネントのプロパティとして設定されます。Object モードprops がオブジェクトの場合、これはコンポーネントプロパティとしてそのまま設定されます。プロパティが静的なときに便利です。const router = new VueRouter({
  routes: [
    { path: '/promotion/from-newsletter', component: Promotion, props: { newsletterPopup: false } }
  ]
})
Function モードプロパティを返す関数を作成することができます。これにより、パラメータを他のタイプにキャストし、静的な値をルートベースの値などと組み合わせることができます。const router = new VueRouter({
  routes: [
    { path: '/search', component: SearchUser, props: (route) => ({ query: route.query.q }) }
  ]
})
URL /search?q=vue は {query: 'vue'} をプロパティとして SearchUser コンポーネントに渡します。ルート変更時にのみ評価されるため、props 関数はステートレスにしてください。プロパティを定義するために状態を必要とする場合はラッパーコンポーネントを使用してください。その方法で vue は状態変更に対応することができます。高度な使い方については、exampleを参照してください。

essentials/history-mode.html.body:
HTML5 History モードvue-router のデフォルトは hash モード です - 完全な URL を hash を使ってシミュレートし、 URL が変更された時にページのリロードが起きません。その hash を取り除くために、ページのリロード無しに URL 遷移を実現する history.pushState API を利用したルーターの history モード を使うことができます。const router = new VueRouter({
  mode: 'history',
  routes: [...]
})
history モードを使用する時は、URL は "普通" に見えます e.g. http://oursite.com/user/id。美しいですね!しかしながら一点問題があります。シングルページのクライアントサイドアプリケーションなので、適切なサーバーの設定をしないと、ユーザーがブラウザで直接 http://oursite.com/user/id にアクセスした場合に 404 エラーが発生します。心配する必要はありません。この問題を直すためには、単純な catch-all フォールバックのためのルートをサーバー側で追加するだけです。もし URL がどの静的なアセットにもマッチしなかった時はあなたのアプリケーションが動作しているのと同じ index.html ページで受け付けましょう。これも美しいですね!サーバーの設定例Apache
  RewriteEngine On
  RewriteBase /
  RewriteRule ^index\.html$ - [L]
  RewriteCond %{REQUEST_FILENAME} !-f
  RewriteCond %{REQUEST_FILENAME} !-d
  RewriteRule . /index.html [L]

nginxlocation / {
  try_files $uri $uri/ /index.html;
}
Native Node.jsconst http = require('http')
const fs = require('fs')
const httpPort = 80

http.createServer((req, res) => {
  fs.readFile('index.htm', 'utf-8', (err, content) => {
    if (err) {
      console.log('We cannot open "index.htm" file.')
    }

    res.writeHead(200, {
      'Content-Type': 'text/html; charset=utf-8'
    })

    res.end(content)
  })
}).listen(httpPort, () => {
  console.log('Server listening on: http://localhost:%s', httpPort)
})
Node.js (Express)Node.js/Express では connect-history-api-fallback middleware の利用を検討してください。Internet Information Services (IIS)IIS UrlRewrite をインストール

以下によるサイトのルートディレクトリに web.config ファイルを作成


















Caddyrewrite {
    regexp .*
    to {path} /
}
Firebase のホスティング以下を firebase.json に追加します:{
  "hosting": {
    "public": "dist",
    "rewrites": [
      {
        "source": "**",
        "destination": "/index.html"
      }
    ]
  }
}
注意この点に関して注意があります。全ての not-found パスが index.html を提供するため、もはや 404 エラーをサーバーがレポートしなくなります。回避策として、Vue アプリケーション内で 404 ページを表示するために catch-all ルートを実装すべきです。const router = new VueRouter({
  mode: 'history',
  routes: [
    { path: '*', component: NotFoundComponent }
  ]
})
他の方法として、もしあなたが Node.js サーバーを使っている場合、入ってきた URL とマッチさせて、マッチしなかった場合に 404 を返答するサーバーサイドのルーターを使って fallback を実装することもできます。詳細については Vue サーバサイドレンダリングのドキュメント を参照してください。

advanced/navigation-guards.html.body:
ナビゲーションガードこの名前が示すように、 vue-router によって提供されるナビゲーションガードは、リダイレクトもしくはキャンセルによって遷移をガードするために主に使用されます。ルートナビゲーション処理 (グローバル、ルート単位、コンポーネント内) をフックする多くの方法があります。パラメータまたはクエリの変更は enter/leave ナビゲーションガードをトリガーしない ということを覚えておいてください。それらの変更に対応するために $route オブジェクトを監視する、またはコンポーネント内ガード beforeRouteUpdate を使用するかの、どちらかができます。グローバルガードrouter.beforeEach を使ってグローバル before ガードを登録できます。const router = new VueRouter({ ... })

router.beforeEach((to, from, next) => {
  // ...
})
いつナビゲーションがトリガーされようとも、グローバル before ガードは作られた順番で呼び出されます。ガードは非同期に解決されるかもしれません。そしてそのナビゲーションは全てのフックが解決されるまで 未解決状態 として扱われます。全てのガード関数は 3 つの引数を受け取ります。to: Route: 次にナビゲーションされる対象の ルートオブジェクト。
from: Route: ナビゲーションされる前の現在のルートです。
next: Function: フックを 解決 するためにこの関数を呼ぶ必要があります。この振る舞いは next に渡される引数に依存します:
next(): パイプラインの次のフックに移動します。もしフックが残っていない場合は、このナビゲーションは 確立 されます。
next(false): 現在のナビゲーションを中止します。もしブラウザのURLが変化した場合は（ユーザーが手動で変更した場合でも、戻るボタンの場合でも）、 from ルートのURLにリセットされます。
next('/') または next({ path: '/' }): 異なる場所へリダイレクトします。現在のナビゲーションは中止され、あたらしいナビゲーションが始まります。任意のロケーションオブジェクトを next に渡すことができます。この next には、replace: true、 name: 'home' のようなオプション、そして router-link、to プロパティまたは router.pushで使用される任意のオプションを指定することができます。
next(error): (2.4.0+) next に渡された引数が Error インスタンスである場合、ナビゲーションは中止され、エラーは router.onError() を介して登録されたコールバックに渡されます。常に next 関数を呼び出すようにしてください。そうでなければ、フックは決して解決されません。
グローバル解決ガードNew in 2.5.02.5.0 以降では、router.beforeResolve によってグローバルガードを登録できます。これは router.beforeEach に似ていますが、すべてのコンポーネント内ガードと非同期ルートコンポーネントが解決された後、ナビゲーションが解決される直前に解決ガードが呼び出されるという違いがあります。グローバルな After フックグローバル after フックを登録することもできます。しかしながら、ガードとは異なり、これらのフックは next 関数を受け取らず、ナビゲーションに影響しません。router.afterEach((to, from) => {
  // ...
})
ルート単位ガード直接ルート設定オブジェクトの beforeEnter ガードを定義することができます。const router = new VueRouter({
  routes: [
    {
      path: '/foo',
      component: Foo,
      beforeEnter: (to, from, next) => {
        // ...
      }
    }
  ]
})
これらのガードはグローバル before ガードと全く同じシグネチャを持ちます。コンポーネント内ガード最後に、 以下のオプションでルートコンポーネント(ルータ設定に渡されるもの)の内側でルートナビゲーションガードを直接定義することができます。beforeRouteEnter

beforeRouteUpdate (2.2 で追加)

beforeRouteLeave

const Foo = {
  template: `...`,
  beforeRouteEnter (to, from, next) {
    // このコンポーネントを描画するルートが確立する前に呼ばれます。
    // `this` でのこのコンポーネントへのアクセスはできません。
    // なぜならばこのガードが呼び出される時にまだ作られていないからです!
  },
  beforeRouteUpdate (to, from, next) {
    // このコンポーネントを描画するルートが変更されたときに呼び出されますが、
    // このコンポーネントは新しいルートで再利用されます。
    // たとえば、動的な引数 `/foo/:id` を持つルートの場合、`/foo/1` と `/foo/2` の間を移動すると、
    // 同じ `Foo` コンポーネントインスタンスが再利用され、そのときにこのフックが呼び出されます。
    // `this` でコンポーネントインスタンスにアクセスできます。
  },
  beforeRouteLeave (to, from, next) {
    // このコンポーネントを描画するルートが間もなく
    // ナビゲーションから離れていく時に呼ばれます。
    // `this` でのコンポーネントインスタンスへのアクセスができます。
  }
}
この beforeRouteEnter ガードは this へのアクセスはできないです。なぜならば、ナビゲーションが確立する前にガードが呼び出されるからです。したがって、新しく入ってくるコンポーネントはまだ作られていないです。しかしながら、 next にコールバックを渡すことでインスタンスにアクセスすることができます。このコールバックはナビゲーションが確立した時に呼ばれ、コンポーネントインスタンスはそのコールバックの引数として渡されます。beforeRouteEnter (to, from, next) {
  next(vm => {
    // `vm` を通じてコンポーネントインスタンスにアクセス
  })
}
コールバックを next に渡すことをサポートするのは、beforeRouteEnterフックだけであるということに注意してください。beforeRouteUpdate と beforeRouteLeave の場合、 this は既に利用可能です。したがって、コールバックを渡す必要はないので、サポートされません:beforeRouteUpdate (to, from, next) {
  // `this` を使用
  this.name = to.params.name
  next()
}
leave ガードは、通常、ユーザが保存されていない編集内容で誤って経路を離れるのを防ぐために使用されます。ナビゲーションは next(false) を呼び出すことで取り消すことができます。beforeRouteLeave (to, from , next) {
  const answer = window.confirm('Do you really want to leave? you have unsaved changes!')
  if (answer) {
    next()
  } else {
    next(false)
  }
}
完全なナビゲーション解決フローナビゲーションがトリガされる

非アクティブ化されたコンポーネントで leave ガードを呼ぶ

グローバル beforeEach ガードを呼ぶ

再利用されるコンポーネントで beforeRouteUpdate ガードを呼ぶ (2.2 以降)

ルート設定内の beforeEnter を呼ぶ

非同期ルートコンポーネントを解決する

アクティブ化されたコンポーネントで beforeRouteEnter を呼ぶ

グローバル beforeResolve ガードを呼ぶ (2.5 以降)

ナビゲーションが確定される

グローバル afterEach フックを呼ぶ

DOM 更新がトリガされる

インスタンス化されたインスンタンスによって beforeRouteEnter ガードで next に渡されたコールバックを呼ぶ

advanced/meta.html.body:
ルートメタフィールドルートの定義をする際に meta フィールドを含めることができます。const router = new VueRouter({
  routes: [
    {
      path: '/foo',
      component: Foo,
      children: [
        {
          path: 'bar',
          component: Bar,
          // メタフィールド
          meta: { requiresAuth: true }
        }
      ]
    }
  ]
})
ではどのように meta フィールドにアクセスしましょう？まず、 routes 設定の中の各ルートオブジェクトはルートレコードと呼ばれます。ルートレコードはネストされているかもしれません。したがって、ルートがマッチした時に、潜在的には 1 つ以上のルートレコードがマッチされる可能性があります。例えば上記のルート設定で、 /foo/bar という URL は親のルートレコードにも子のルートレコードにもマッチします。ルートにマッチした全てのルートレコードは $route.matched 配列として $route オブジェクト上で (また、ナビゲーションガード上のルートオブジェクトでも) アクセス可能になります。メタフィールドをグローバルナビゲーションガードで確認するユースケースの例:router.beforeEach((to, from, next) => {
  if (to.matched.some(record => record.meta.requiresAuth)) {
    // このルートはログインされているかどうか認証が必要です。
    // もしされていないならば、ログインページにリダイレクトします。
    if (!auth.loggedIn()) {
      next({
        path: '/login',
        query: { redirect: to.fullPath }
      })
    } else {
      next()
    }
  } else {
    next() // next() を常に呼び出すようにしてください!
  }
})

