advanced/data-fetching.html.body:
データ取得ルートが有効化された時にサーバーからデータを取得する必要がしばしばあります。例えば、ユーザープロフィールを描画する前に、サーバーからユーザーデータを取得する必要があります。これを実現するためには 2 種類の方法があります。ナビゲーション後の取得: ナビゲーションを先に実行し、その後次に入ってくるコンポーネントのライフサイクルフック内でデータを取得します。データ取得中にローディングを表示します。
ナビゲーション前の取得: ルートに入るガード内でナビゲーション前にデータ取得をします。そして、データ取得後にナビゲーションを実行します。
技術的にはどちらも正当な選択肢です。究極的にはあなたが目指しているユーザーエクスペリエンスに依存します。ナビゲーション後の取得このアプローチを取る時は次に来るコンポーネントが即座にナビゲーションされ、描画されます。そして、コンポーネントの created フックの中でデータを取得します。この方法ではネットワーク越しにデータを取得している間にローディング状態を表示する機会があります。また、各 view に対して、異なるローディングの対応をすることもできます。$route.params.id を元にポストのデータを取得する必要がある Post コンポーネントを想定してみましょう。


      Loading...



      {{ error }}



      {{ post.title }}
      {{ post.body }}



export default {
  data () {
    return {
      loading: false,
      post: null,
      error: null
    }
  },
  created () {
    // view が作られた時にデータを取得し、
    // そのデータは既に監視されています
    this.fetchData()
  },
  watch: {
    // ルートが変更されたらこのメソッドを再び呼び出します
    '$route': 'fetchData'
  },
  methods: {
    fetchData () {
      this.error = this.post = null
      this.loading = true
      // `getPost` をあなたのデータ取得用 util や API ラッパーに置き換えてください
      getPost(this.$route.params.id, (err, post) => {
        this.loading = false
        if (err) {
          this.error = err.toString()
        } else {
          this.post = post
        }
      })
    }
  }
}
ナビゲーション前の取得こちらのアプローチでは新しいルートへ実際にナビゲーションする前にデータを取得します。次に入ってくるコンポーネント内の  beforeRouteEnter ガードでデータ取得を実行できます。データ取得が完了したら next を呼ぶだけです。export default {
  data () {
    return {
      post: null,
      error: null
    }
  },
  beforeRouteEnter (route, redirect, next) {
    getPost(route.params.id, (err, post) => {
      next(vm => vm.setData(err, post))
    })
  },
  // コンポーネントが既に描画されている際のルート変更時は
  // ロジックが少し異なります
  beforeRouteUpdate (to, from, next) {
    this.post = null
    getPost(to.params.id, (err, post) => {
      this.setData(err, post)
      next()
    })
  },
  methods: {
    setData (err, post) {
      if (err) {
        this.error = err.toString()
      } else {
        this.post = post
      }
    }
  }
}
次に入ってくる view へのリソースを取得している間、ユーザーは前の view に滞在します。したがって、データ取得中にプログレスバーや何らかの指標を表示することをオススメします。また、もしデータ取得が失敗した場合、何かグローバルな警告メッセージのようなものを表示する必要があります。

advanced/scroll-behavior.html.body:
スクロールの振る舞いクライアントサイドのルーティングを使っている時に、新しいルートに対してスクロールをトップへ移動させたいかもしれません、もしくは実際のページリロードがしているように history 要素のスクロールポジションを保持したいこともあるかもしれません。 vue-router ではこれらをさらによく実現できます。ルートナビゲーションにおけるスクロールの挙動を完全にカスタマイズすることができます。注意: この機能は ブラウザが history.pushState をサポートしている場合のみ動作します。ルーターインスタンスを作る時に、 scrollBehavior 関数を提供できます。const router = new VueRouter({
  routes: [...],
  scrollBehavior (to, from, savedPosition) {
    // 望みのポジションを返す
  }
})
scrollBehavior 関数は  to と from のルートオブジェクトを受け取ります。第 3 引数の savedPosition は popstate ナビゲーション (ブラウザの戻る/進むボタンがトリガーされた) 時のみ利用可能です。この関数はスクロールポジションオブジェクトを返すことができます。そのオブジェクトは以下のような形式です。{ x: number, y: number }

{ selector: string }

{ selector: string, offset? : { x: number, y: number }} (2.6.0 以降においてだけ offset はサポート)

もし falsy な値や空のオブジェクトが返った場合、何もスクロールは起きません。例:scrollBehavior (to, from, savedPosition) {
  return { x: 0, y: 0 }
}
これは単純に全てのルートナビゲーションに対してページスクロールをトップにします。savedPosition を返すことは結果的に戻る/進むボタンを押してナビゲーションした時にネイティブのような挙動になります。scrollBehavior (to, from, savedPosition) {
  if (savedPosition) {
    return savedPosition
  } else {
    return { x: 0, y: 0 }
  }
}
もし"アンカーへスクロール"の振る舞いをシミュレートしたい場合は以下のようにしてください。scrollBehavior (to, from, savedPosition) {
  if (to.hash) {
    return {
      selector: to.hash
      // , offset: { x: 0, y: 10 }
    }
  }
}
きめの細かいスクロールの挙動コントロールを実装するために ルートメタフィールド も利用可能です。詳細な例は こちら をご参照ください。非同期なスクローリング2.8.0 で新規期待する位置記述子 (position descriptor) に解決されるプロミスを返すこともできます:scrollBehavior (to, from, savedPosition) {
  return new Promise((resolve, reject) => {
    setTimeout(() => {
      resolve({ x: 0, y: 0 })
    }, 500)
  })
}
スクロールの振る舞いをページの遷移とうまく合わせるために、ページレベルのトランジションコンポーネントからのイベントにフックすることは可能ですが、ユースケースにおいて可能性のある食い違いと複雑さのために、単純に特定のユーザランド実装を可能にするために、このプリミティブな機能を提供します。

